import React, { useEffect, useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const GetAllUser = () => {
  const [items, setItems] = useState([]);

  useEffect(() => {
    fetch('http://localhost:5000/api/viewusers')
      .then(response => response.json())
      .then(data => {
        setItems(data);
      })
      .catch(err => console.log(err));
  }, []);

  return (
    <div className="container-fluid">
      <h2 className='text-center my-4'>View Users</h2>
      <div className="table-responsive">
        <table className="table table-dark table-bordered table-hover align-middle text-center">
          <thead className="table-active">
            <tr>
              <th>Image</th>
              <th>Username</th>
              <th>Useremail</th>
              <th>Created at</th>
            </tr>
          </thead>
          <tbody>
            {
              items.map(item => (
                <tr key={item._id}>
                  <td>
                    <img 
                      src={item.profilePic || "https://cdn-icons-png.flaticon.com/512/3135/3135715.png"} 
                      alt={item.name} 
                      className="img-fluid rounded"
                      style={{ maxWidth: '100px', maxHeight: '100px' }} 
                    />
                  </td>
                  <td>{item.name}</td>
                  <td>{item.email}</td>
                  <td>{new Date(item.createdat).toLocaleString()}</td>
                </tr>
              ))
            }
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default GetAllUser;
